// SPDX-License-Identifier: MIT

pragma solidity ^0.8.15;



contract  MoneyTransfer {


    struct  Payment  {
        uint256  amount;
        uint  timestamp;
    }

    mapping (address => Payment[]) public mainMap;
    
    uint256 public TotalFunds;
    address receiver ;
   // uint256 constant limit = 2000;
   // uint day = 24 hours;
   // uint256 public totalWeekTransactions;
   // uint maxTransaction;
   // uint minTransaction;
   // uint256[] countries ; 
    //uint256 public receiverFunds;
    string public message;
    string public cardNumber ;
    string public cvv;
    uint256 public TotalAmount ;
    uint public firstTransferTime;
   // uint public countTransfer ;



    constructor (uint256 _totalFunds) {
        // cardNumber = _cardNumber;
        // cvv = _cvv;
        TotalFunds = _totalFunds;
    }



    uint public callCount = 0 ;
    bool public callPutCard = false ;

    function sendMoney( uint _amount, address _receiver, uint _timestamp) public m_validAddress(_receiver) m_ifCardExists m_transferLimit{
        receiver = _receiver;
        //amount = _amount;

        // if(amount > 2500){
        //     revert("You reached the limit Send()");
        // }
        

        Payment memory paymentDetails = Payment(_amount,_timestamp);
                
                      callCount += 1;
                

                 if(TotalFunds > 0 && TotalFunds > paymentDetails.amount){

                    Payment[] storage payment = mainMap[msg.sender];
                     payment.push(Payment({amount:_amount, timestamp: block.timestamp}));
                     mainMap[msg.sender] = payment; 
                    TotalFunds -= paymentDetails.amount;
                    TotalAmount += paymentDetails.amount;
                    
                    message = "Transfer completed";
                    
                    // getOutCard();
                 }
                 else{
                     revert("Not enough funds");
                 }

                 
    
            }

    function setCard(string memory _cardNumber, string memory _cvv) public  m_checkCard {

            cardNumber = _cardNumber;
            cvv = _cvv;

            

             callPutCard = true;

             firstTransferTime = block.timestamp;

    }

   




    function getOutCard() public  {
       callPutCard = false;

    }



    

    modifier m_validAddress(address _addr) {
        receiver = _addr;
        require(_addr != address(0), " This address doesn't exists");

        _;
    }

   

    modifier m_ifCardExists() {

        require(callPutCard != false,"Please insert your card");

        _;
    }

     modifier m_checkCard() {
         

        _;


       require(bytes(cardNumber).length == 8 && bytes(cvv).length == 3, "No valid credit card");
    
        
    }

    modifier m_transferLimit(){
         
        

        //require (TotalAmount <= 2500 , "You reached the limit");
        
        //require(callCount <= 5 && block.timestamp <= (firstTransferTime + 30 seconds),"you cannot make more than 5 transactions per day");
        //require( callCount <= 5 && block.timestamp <= (firstTransferTime + 30 seconds), "Time passed");

        
        // while(callCount <= 5 && block.timestamp >= (firstTransferTime + 30 seconds)){
        //             firstTransferTime = block.timestamp;
        //         }

        // if(TotalAmount > 2500 && block.timestamp <= (firstTransferTime + 30 seconds)){
        //     TotalAmount = 0;
        //     assert(TotalAmount == 0) ;
        //     revert("You reached the limit per day");
        // }

        // if(TotalAmount <= 2500 && block.timestamp >= (firstTransferTime + 30 seconds)){
        //      TotalAmount = 0;
        //     assert(TotalAmount == 0);
        //     firstTransferTime = block.timestamp;
        // }

        if(callCount >= 5 && block.timestamp <= (firstTransferTime + 30 seconds)){
            callCount = 0;
            assert(callCount == 0);
            revert("only 5 transactions per day" );
            
        }

        if(callCount <= 5 && block.timestamp >= (firstTransferTime + 30 seconds)){
            callCount = 0;
             assert(callCount == 0);
            firstTransferTime = block.timestamp;
        }

        _;


    }


    function getTime()public view returns(uint ){
        return  block.timestamp;
    }

    
}

